import React from "react";


function ConCard(prop){
    return (
        <div className="col-5 bg-dark text-white m-1  f"  style={{padding:"15px"}}>
               <img src={prop.obj.img}/>
               <h3>{prop.obj.name}</h3>
               <h6>phone {prop.obj.phone}</h6>
               <h6>emmil  {prop.obj.email}</h6>
        </div>
    )
}
export default ConCard
